import React from 'react';

import NumberDisplay from "./numberdisplay"
import "./tridata.css"

class Tridata extends React.Component {
    constructor (props) {
        super(props);

        this.state = {
            "environment.depth.belowTransducer": 2.7,
            "navigation.speedOverGround": 5.2,
            "performance.velocityMadeGood": 3.0
        }

        this.onMessage = (message) => {
            console.log("Tridata here");
            // console.log(message.values[0].path)

            let path = message.values[0].path;

            // console.log("Wind prop: " + path)
            // console.log(this.state)

            if (path in this.state) {
                // console.log("moioioioi" + message.values[0].value)
                this.setState({
                    [path]: message.values[0].value
                })
            } else {

                console.log(path)
            }

        }

        this.props.subscribe(["depth.belowTransducer", "navigation.speedOverGround", "performance.velocityMadeGood"], this.onMessage)
    }

    render () {
        return <div className="container" style={{ width: this.props.width + "px", height: this.props.height + "px" }}>
            <NumberDisplay
                value={this.state["environment.depth.belowTransducer"]}
                suffix=""
                unit="m"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={1}
                fontSize={this.props.width / 4}
            />
            <NumberDisplay
                value={this.state["navigation.speedOverGround"] * 3.6 / 1.852}
                suffix=""
                unit="kts"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={2}
                fontSize={this.props.width / 4}
            />
            <NumberDisplay
                value={this.state["performance.velocityMadeGood"]}
                suffix=""
                unit="m/s"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={1}
                fontSize={this.props.width / 4}
            />
        </div>
    }
}

export default Tridata;
